import React from "react";

const Footer = () => {
  const footerStyles = {
    footer: {
      width: "1440px",
      margin: "0 auto",
      background: "#ffffff",
      padding: "40px 20px",
      textAlign: "center",
      position: "relative",
      overflow: "hidden",
    },
    footerContent: {
      display: "flex",
      justifyContent: "space-between",
      alignItems: "flex-start",
      flexWrap: "wrap",
      color: "#333333",
      fontFamily: "Arial, sans-serif",
    },
    footerSection: {
      flex: 1,
      minWidth: "250px",
      margin: "10px",
    },
    footerHeading: {
      fontSize: "18px",
      marginBottom: "15px",
      fontWeight: "bold",
    },
    footerText: {
      fontSize: "14px",
      lineHeight: "1.6",
      color: "#555555",
    },
    footerList: {
      listStyle: "none",
      padding: 0,
      margin: 0,
    },
    footerItem: {
      marginBottom: "10px",
    },
    footerLink: {
      textDecoration: "none",
      color: "#007BFF",
      fontSize: "14px",
    },
  };

  return (
    <div style={footerStyles.footer}>
      <div style={footerStyles.footerContent}>
        {/* About Us Section */}
        <div style={footerStyles.footerSection}>
          <h4 style={footerStyles.footerHeading}>About Us</h4>
          <p style={footerStyles.footerText}>
            We are dedicated to providing high-quality services with a focus on
            customer satisfaction and innovation.
          </p>
        </div>

        {/* Quick Links Section */}
        <div style={footerStyles.footerSection}>
          <h4 style={footerStyles.footerHeading}>Quick Links</h4>
          <ul style={footerStyles.footerList}>
            <li style={footerStyles.footerItem}>
              <a href="#home" style={footerStyles.footerLink}>
                Home
              </a>
            </li>
            <li style={footerStyles.footerItem}>
              <a href="#services" style={footerStyles.footerLink}>
                Services
              </a>
            </li>
            <li style={footerStyles.footerItem}>
              <a href="#contact" style={footerStyles.footerLink}>
                Contact Us
              </a>
            </li>
          </ul>
        </div>

        {/* Follow Us Section */}
        <div style={footerStyles.footerSection}>
          <h4 style={footerStyles.footerHeading}>Follow Us</h4>
          <p style={footerStyles.footerText}>
            Stay connected with us on social media for the latest updates.
          </p>
          <p>
            <a href="https://facebook.com" style={footerStyles.footerLink}>
              Facebook
            </a>{" "}
            |{" "}
            <a href="https://twitter.com" style={footerStyles.footerLink}>
              Twitter
            </a>{" "}
            |{" "}
            <a href="https://instagram.com" style={footerStyles.footerLink}>
              Instagram
            </a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Footer;
